import styled from "styled-components";

export const FatTitle = styled.h1`
  font-family: "garnett_bold";
  font-style: normal;
  font-weight: bold;
  font-size: 80px;
  line-height: 95px;
  color: ${props => props.theme.colors.white};
`;

export const Navigation = styled.p`
  font-family: "garnett_regular";
  font-style: normal;
  font-weight: normal;
  font-size: 14px;
  line-height: 20px;
  color: ${props => props.theme.colors.white};
`;

export const SmallNavigation = styled.p`
  font-family: "garnett_regular";
  font-style: normal;
  font-weight: normal;
  font-size: 12px;
  line-height: 17px;
  color: ${props => props.theme.colors.white};
`;

export const Subtitle = styled.h3`
  font-family: "garnett_regular";
  font-style: normal;
  font-weight: normal;
  font-size: 16px;
  line-height: 25px;
  letter-spacing: 0.1em;
  text-transform: uppercase;
  color: ${props => props.theme.colors.black};
`;

export const SmallSubtitle = styled.h4`
  font-family: "garnett_regular";
  font-style: normal;
  font-weight: normal;
  font-size: 10px;
  line-height: 15px;
  letter-spacing: 0.1em;
  text-transform: uppercase;
  color: ${props => props.theme.colors.black};
`;

export const Chapeau = styled.h3`
  font-family: "garnett_medium";
  font-style: normal;
  font-weight: 500;
  font-size: 28px;
  line-height: 43px;
  color: ${props => props.theme.colors.white};
`;

export const ExpertiseTitle = styled.h3`
  font-family: "garnett_medium";
  font-style: normal;
  font-weight: 500;
  font-size: 28px;
  line-height: 43px;
  color: ${props => props.theme.colors.black};
`;

export const ArticleTitle = styled.h3`
  font-family: "garnett_bold";
  font-style: normal;
  font-weight: bold;
  font-size: 50px;
  line-height: 71px;
  color: ${props => props.theme.colors.blue};
`;

export const Labor = styled.p`
  font-family: "garnett_regular";
  font-style: normal;
  font-weight: normal;
  font-size: 16px;
  line-height: 25px;
  color: ${props => props.theme.colors.black};
`;

export const FatLabor = styled.p`
  font-family: "garnett_medium";
  font-style: normal;
  font-weight: 500;
  font-size: 28px;
  line-height: 40px;
  color: ${props => props.theme.colors.white};
`;

export const ArticleInterTitle = styled.h4`
  font-family: "garnett_medium";
  font-style: normal;
  font-weight: 500;
  font-size: 20px;
  line-height: 28px;
  color: ${props => props.theme.colors.blue};
`;
